import React from 'react';
import { useState, Fragment } from 'react'
import { Listbox, Transition, Combobox } from '@headlessui/react'

const MahasiswaList = Array.from({ length: 10 }, (_, i) => `mahasiswa_${i + 1}`);

const AspekOptions = [
  { value: "aspek_penilaian_1", label: "Aspek Penilaian 1" },
  { value: "aspek_penilaian_2", label: "Aspek Penilaian 2" },
  { value: "aspek_penilaian_3", label: "Aspek Penilaian 3" }
];

const OptionValues = Array.from({ length: 10 }, (_, i) => i + 1);

function App() {

  const [ values, setValues ] = useState({});

  const handleChangeAspekPenilaian = (aspek, mahasiswa, selectedValue) => {
    setValues((prevValues) => ({
      ...prevValues,
      [ aspek ]: {
        ...prevValues[ aspek ],
        [ mahasiswa ]: selectedValue
      }
    }));
  };

  const handleSave = () => {
    console.log(values);
  };


  return (
    <div className="container">
      <div className="flex justify-between">
        <div className="text-white lg:w-[100px] w-[200px]"></div>
        {AspekOptions.map((aspek) => (
          <div key={aspek.value} className="text-white lg:w-[200px] w-auto">
            {aspek.label}
          </div>
        ))}
      </div>
      {[ ...Array(10) ].map((_, index) => (
        <div key={index} className="mt-1 p-3 flex items-center justify-between bg-white rounded-lg">
          <div className="flex gap-2">
            <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" className="w-6 h-6">
              <path strokeLinecap="round" strokeLinejoin="round" d="M17.982 18.725A7.488 7.488 0 0012 15.75a7.488 7.488 0 00-5.982 2.975m11.963 0a9 9 0 10-11.963 0m11.963 0A8.966 8.966 0 0112 21a8.966 8.966 0 01-5.982-2.275M15 9.75a3 3 0 11-6 0 3 3 0 016 0z" />
            </svg>
            <div>{`Mahasiswa ${index + 1}`}</div>
          </div>
          <div className="lg:w-[200px] w-auto">
            <Listbox value={selectedAspekPenilaian1} onChange={handleChangeAspekPenilaian1}>
              <div className="relative mt-1">
                <Listbox.Button className="relative w-full cursor-default rounded-lg bg-white py-2 pl-3 pr-10 text-left shadow-md focus:outline-none focus-visible:border-indigo-500 focus-visible:ring-2 focus-visible:ring-white focus-visible:ring-opacity-75 focus-visible:ring-offset-2 focus-visible:ring-offset-yellow-600 sm:text-sm ">
                  <span type="text" name="articleType" value={state.aspek_penilaian_1} className="block truncate text-[#212529]">
                    {selectedAspekPenilaian1 ? selectedAspekPenilaian1 : "Pilih"}
                  </span>
                  <span className="pointer-events-none absolute inset-y-0 right-0 flex pr-2 mt-2">
                    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" className="w-5 h-5 text-black cursor-pointer">
                      <path strokeLinecap="round" strokeLinejoin="round" d="M19.5 8.25l-7.5 7.5-7.5-7.5" />
                    </svg>
                  </span>
                </Listbox.Button>
                <Transition
                  as={Fragment}
                  leave="transition ease-in duration-100"
                  leaveFrom="opacity-100"
                  leaveTo="opacity-0"
                >
                  <Listbox.Options className="absolute mt-1 z-10 max-h-60 w-full overflow-auto rounded-md bg-white py-1 text-base shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none sm:text-sm">
                    {aspek_penilaian_1.map((aspek_penilaian_1, x) => (
                      <Listbox.Option
                        key={x}
                        className={({ active }) =>
                          `relative cursor-default select-none py-2 pl-3 pr-4 ${active ? 'bg-[#FFC20A] text-black' : 'text-gray-900'
                          }`
                        }
                        value={aspek_penilaian_1}
                      >
                        {({ selectedAspekPenilaian1 }) => (
                          <>
                            <span
                              className={`block truncate ${selectedAspekPenilaian1 ? 'font-medium' : 'font-normal'
                                }`}
                            >
                              {aspek_penilaian_1.tipe}
                            </span>
                          </>
                        )}
                      </Listbox.Option>
                    ))}
                  </Listbox.Options>
                </Transition>
              </div>
            </Listbox>
          </div>
          <div className="lg:w-[200px] w-auto">
            <Listbox value={selectedAspekPenilaian2} onChange={handleChangeAspekPenilaian2}>
              <div className="relative mt-1">
                <Listbox.Button className="relative w-full cursor-default rounded-lg bg-white py-2 pl-3 pr-10 text-left shadow-md focus:outline-none focus-visible:border-indigo-500 focus-visible:ring-2 focus-visible:ring-white focus-visible:ring-opacity-75 focus-visible:ring-offset-2 focus-visible:ring-offset-yellow-600 sm:text-sm ">
                  <span type="text" name="articleType" value={state.aspek_penilaian_2} className="block truncate text-[#212529]">
                    {selectedAspekPenilaian2 ? selectedAspekPenilaian2 : "Pilih"}
                  </span>
                  <span className="pointer-events-none absolute inset-y-0 right-0 flex pr-2 mt-2">
                    <svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" strokeWidth="1.5" stroke="currentColor" className="w-5 h-5 text-black cursor-pointer">
                      <path strokeLinecap="round" strokeLinejoin="round" d="M19.5 8.25l-7.5 7.5-7.5-7.5" />
                    </svg>

                  </span>
                </Listbox.Button>
                <Transition
                  as={Fragment}
                  leave="transition ease-in duration-100"
                  leaveFrom="opacity-100"
                  leaveTo="opacity-0"
                >
                  <Listbox.Options className="absolute z-10 mt-1 max-h-60 w-full overflow-auto rounded-md bg-white py-1 text-base shadow-lg ring-1 ring-black ring-opacity-5 focus:outline-none sm:text-sm">
                    {aspek_penilaian_2.map((aspek_penilaian_2, x) => (
                      <Listbox.Option
                        key={x}
                        className={({ active }) =>
                          `relative cursor-default select-none py-2 pl-3 pr-4 ${active ? 'bg-[#FFC20A] text-black' : 'text-gray-900'
                          }`
                        }
                        value={aspek_penilaian_2}
                      >
                        {({ selectedAspekPenilaian2 }) => (
